formatting.html.body:
フォーマティング (Formatting)フォーマッティング問題は重要ではありませんが、最も議論の通りです。人々はそれぞれ異なるフォーマットスタイルを適用するかもしれませんが、誰もが同じスタイルに固執し、もはやそれを必要としなくなり、フォーマットのトピックにあまり気にしないでください。問題は長く、規則的なスタイルガイドなしでいかにこのユートピアにアクセスできるかである。Goでは、私たちは新しいアプローチを取り、マシンに大部分のフォーマット問題を処理させることができます。 gofmtプログラム（ go fmtとしても使用できます。これはソースファイルではなくパッケージレベルで実行されます）はGoプログラムを読み、標準スタイルのインデントと垂直整列、維持、そして必要に応じてコメントを再フォーマットします。ソースを出す。例えば、Goでは、構造体のフィールドに書かれた注釈を整列するのに気を使う必要はありません。 Gofmtが代わってくれるだろう。以下を見てみましょう。type T struct {
    name string // name of the object
    value int // its value
}
gofmtは各列を次のようにソートしますtype T struct {
    name    string // name of the object
    value   int    // its value
}
標準パッケージのすべてのGoコードは gofmtでフォーマットされています。いくつかのフォーマッティングの詳細が残っているが、これを非常に簡単に要悪してみると次のようになる。インデントインデントにはタブを使用し、 gofmtはデフォルトでタブを使用します。書く必要がある場合にのみスペースを使用してください。一行の長さGoは一行の長さに制限がありません。長さが長くなるのを心配しないでください。行の長さが長すぎると感じる場合は、別のタブを持ってインデントして包みます。かっこGoはCとJavaに比べて少数の括弧が必要です。制御構造（ if、 for、 switch）の文法には括弧はありません。また、演算子優先順位階層が単純で明確である。以下を見てみましょう。x
他の言語とは異なり、スペースの使用が意味するところが大きい。

names.html.body:
名称他の言語と同様に、Goでも名前は重要です。これも意味に影響を与える可能性があります。名前の最初の文字が大文字であるかどうかによって、名前のパッケージ外での露出可否が決まる。したがって、Goのネーミングルールを見る必要があります。パッケージ名パッケージがインポートされると、パッケージ名はパッケージの内容へのアクセス者になります。次のようにするとimport "bytes"
インポートしたパッケージは bytes.Buffer を使うことができる。パッケージを使用するすべての人がパッケージの内容を参照するために同じ名前を使用できるということは、パッケージ名をよく作成しなければならない（短く、簡潔で、思いやりやすい）ことを意味します。慣例的に、パッケージ名は小文字、一単語でのみ付与し、アンダーバー（_）や大小文字混用の必要はありません。これは簡潔さに取り組んでいます。パッケージを使用するすべての人がパッケージ名を直接入力するからです（利便性）。そして衝突の心配はしないでください。パッケージ名はインポートのみの名前です。これはすべてのソースコードで一意である必要はなく、まれにインポートするパッケージがクラッシュしたときにローカルに異なる名前を選択することができます。いずれにせよ、インポートにあるファイル名が使用されるパッケージ名をすぐに決めるため、混乱はまれです。別の規則は、パッケージ名はソースディレクトリ名ベースであるということです。 src/encoding/base64のパッケージは encoding/base64にインポートされます。 base64という名前を持っていますが、encoding_base64やencodingBase64を書きません。パッケージをインポートするという点では、パッケージの内容を参照するためにパッケージ名を使用するので、パッケージから公開されている名前は名前の汚れを避けるためにこの事実を利用することができます。 （ import .表現を使用しないでください。これは、テストを実行しているパッケージの外部で本質的に実行する必要があるテストを単純化することができますが、そうでない場合は避けるべきです）。バッファリーダーは BufReaderではなく Readerと呼ばれます。なぜなら、ユーザーはこれを bufio.Readerと見なすでしょう。さらに、インポートされたオブジェクトは常にパッケージ名と呼ばれるため、 bufio.Readerは io.Readerと競合しません。同様に、Goに存在する ring.Ringという構造体のインスタンスを作成する関数は通常は NewRingと呼ばれるが、 Ringはパッケージ外に露出された唯一の型であり、パッケージが ringと呼ばれるため、この関数は単に Newと呼び、 ring.Newのように使用します。良い名前のためにこれらのパッケージ構造を活用してください。もう一つの簡単な例は once.Doです。 once.Do(setup) は読みやすく、 once.DoOrWaitUntilDone(setup) で改善されない。長い名前はもっと読みやすくなります。文書に注釈を付けるのが長い名前を使用するよりも良いでしょう。ゲッターGoはゲッターとセッターを独自に提供しません。自分でゲッターとセッターを作成して使用することができますが、これはまったく問題にはなりません。しかし、ゲッターの名前にGetを入れるのはGo言語の答えでも必須でもない。 owner（最初の文字が小文字でパッケージ外に公開されない）というフィールドを持っている場合、getterメソッドはGetOwnerではなくOwner（最初の文字が大文字で、パッケージから公開される）と呼ばれるべきです。パッケージ外に公開するために大文字の名前を使用することは、メソッドからフィールドを識別するためのフックを提供します。必要であれば、setter関数はSetOwnerと呼ばれます。どちらの名前も読みやすいです。owner := obj.Owner()
if owner != user {
    obj.SetOwner(user)
}
インターフェース名慣例的に、1つのメソッドを持つインタフェースは、メソッド名に `-er'サフィックスを付けるか、エージェント名詞を構成する同様の変形によって指定される。例えば、Reader、Writer、Formatter、CloseNotifierなどがある。この種の名前があり、これらとそれらを通して知ることができる関数名を守っていくのは生産的です。 Read、Write、Close、Flush、Stringなどは各角度の用法と意味を持っている。混乱を避けるために、同じ使用法と意味を持たない限り、メソッドにこれらの名前と同じ名前を付けないでください。逆に言えば、あなたが実装した型に既によく知られている型が持っているメソッドと同じ意味を持つメソッドを実装しようとするなら、同じ名前を与えればよい。文字変換メソッドを作成する場合は、 ToStringではなく Stringを使用してください。大文字と小文字の混合最後に、Goでのネーミングルールは、複数の単語の名前を命名するときにアンダーバー（_）の代わりに大文字と小文字の混合（ MixedCapsまたは mixedCaps）を使用することです。

control_structures.html.body:
制御構造Go言語の制御構造はCと関連性があるが重要な点で違いがある。 Go言語ではdoやwhileの繰り返し文は存在せず、ただもっと一般化されたfor、もう少し柔軟なswitchが存在する。 ifとswitchはオプションで forのような初期化構文を受け取ることができます。 breakとcontinueの構文は、オプションでどれを停止するか継続するかを識別するためにラベルを受け取ることができます。また、「タイプswitch」と「多方向通信マルチプレクサ」、「select」の新しい制御構造も含まれています。文法は少し違う。かっこは必要ではなく、bodyは常に中かっこで区切る必要があります。IfGo言語でのif文の簡単な例は次のとおりです:if x > 0 {
    return y
}
中かっこを義務的に使用する必要があるため、複数行でif構文が簡単に作成されます。どうせそうするのが良いスタイルであり、特に構文本体に return や break のような制御構文を含んでいる場合にはさらにそうです。ifとswitchは初期化構文を受け入れるので、ローカル変数を設定するために使用された初期化構文がよく見られます。if err := file.Chmod(0664); err != nil {
    log.Print(err)
    return err
}
Go 複数のライブラリを見ると、if 構文が次の構文に進まないとき、つまり break、continue、goto または return によって構文本体が終了する場合、不要な else は省略されるものを見つけることができる。f, err := os.Open(name)
if err != nil {
    return err
}
codeUsing(f)
以下は、コードが一連のエラー条件を必ずチェックする必要がある一般的な状況の例です。制御の流れが成功した場合、コードはうまく動作し、エラーが発生するたびにエラーを排除します。エラーケースは return 構文で終了する傾向があるため、結果としてコードに `else' 構文は必要ありません。f, err := os.Open(name)
if err != nil {
    return err
}
d, err := f.Stat()
if err != nil {
    f.Close()
    return err
}
codeUsing(f, d)
再宣言と再割り当て続いて：前のセクションの最後の例では、：=短い宣言がどのように機能するかを確認できました。 os.Openを呼び出す宣言コードを見てみましょう。f, err := os.Open(name)
この構文は fと errの2つの変数を宣言します。いくつかの行の下で f.Stat を呼び出す部分を見てみましょう。d, err := f.Stat()
ここで d と err を宣言するようです。注目すべき点は、その errが上から下の両方に現れるということです。この宣言の重複は合法的です。 errは最初の構文で宣言されていますが、2番目は再割り当てされています。これは、 f.Stat を呼び出すことでは、すでに宣言されて存在する err 変数を使用し、再び新しい値を与えるということを意味する。変数の短縮宣言、 v := で変数 v はすでに宣言されていても、次の場合に再宣言が可能です。この宣言が既存の宣言と同じスコープになければなりません（vがすでに外部スコープに宣言されている場合は、この宣言は新しい変数を作成します。）、

