このユニークな属性は完全に実用的であり、たとえば長く連鎖したif-else構文で1つのエラー値を簡単に使用できるようにします。よく使われるものを見るでしょう。§Go言語の関数パラメータと戻り値は、関数を包んでいるブライスの外側にあるにもかかわらず、そのスコープは関数の胴体のスコープと同じであることに注意する価値があります。ForGo言語では、forイテレーションはC言語と似ていますが、一致しません。 forはwhileのように動作することができ、したがってdo-whileはありません。次の3つの形式が確認でき、1つの場合にのみセミコロンが使用されることが確認できます。// C言語と同じ場合
for init; condition; post { }

// C言語のwhileのように使用
for condition { }

// C언어의 for(;;) のように
for { }
短い宣言文は、反復文でindex変数宣言を簡単にします。sum := 0
for i := 0; i 
配列、slice、string、map、およびチャネルから読み込む反復文を作成する場合、range構文はこの反復文を管理できます。for key, value := range oldMap {
    newMap[key] = value
}
rangeの中で最初のアイテムだけが必要な場合（キーまたはインデックス）、2番目の後ろを吹き飛ばそう:for key := range m {
    if key.expired() {
        delete(m, key)
    }
}
range内で2番目のアイテムだけが必要な場合（値）、空白識別子、アンダースコアを使用して最初を捨てるようにしましょう:sum := 0
for _, value := range array {
    sum += value
}
空白識別子には多くの使用法があり、[後で表示するセクション]（https://golang.org/doc/effective_go.html#blank）でよく説明されています。文字列の場合、rangeはUTF-8解析によって個々のUnicode文字を処理するのに役立ちます。誤ったエンコーディングは、1バイトを削除し、U + FFFDルーン文字に置き換えます。 （ルーン（組み込み型で指定された）の名前はGo言語の単一のUnicodeコードの用語です。詳細は[言語仕様]（https://golang.org/ref/spec#Rune_literals） )次の繰り返し文はfor pos, char := range "日本\x80語" { // \x80は正当なUTF-8エンコーディングです
    fmt.Printf("character %#U starts at byte position %d\n", char, pos)
}
次のように出力されるcharacter U+65E5 '日' starts at byte position 0
character U+672C '本' starts at byte position 3
character U+FFFD '�' starts at byte position 6
character U+8A9E '語' starts at byte position 7
最後に、Go言語はコンマ（、）演算子を持たず、++、--は式ではなくステートメントです。したがって、for文内で複数の変数を使用するには、パラレル割り当てを使用する必要があります（++と-を除外しても）。// Reverse a
for i, j := 0, len(a)-1; i 
SwitchGo言語では、スイッチはC言語よりも一般的な表現が可能です。式は定数であるか、必ずしも整数である必要はなく、case構文は上から底まで、その構文が trueでない間に一致する値が見つかるまで値を比較します。したがって、 if-else-if-elseの形式で書くのではなく、 switchを使うことが可能であるともっとGo言語らしい。func unhex(c byte) byte {
    switch {
    case '0' 
スイッチでは自動的に次に通過する動作はないが（ケース構文を通る動作）、コンマ区切りリストを使用してケースを表現することができる。func shouldEscape(c byte) bool {
    switch c {
    case ' ', '?', '&', '=', '#', '+', '%':
        return true
    }
    return false
}
Cのような言語ではそれほど普遍的ではありませんが、Goでもbreak構文でswitchを早く終了するために書くことができます。たまには、スイッチではなく囲まれた繰り返し文を中断することが必要なこともあり、ラベルを繰り返し文の上に入れて、該当ラベルで「脱出」することによって完了することもある。次の例は、この2つの使用例です。Loop:
    for n := 0; n = len(src) {
                err = errShortInput
                break Loop
            }
            if validateOnly {
                break
            }
            size = 2
            update(src[n] + src[n+1]
もちろん、continue構文もオプションでラベルを受け取ることができますが、反復文にのみ適用されます。セクションを終了し、次は2つの switch構文を使用してバイトスライスを比較するルーチンの例です。:// Compare returns an integer comparing the two byte slices,
// lexicographically.
// The result will be 0 if a == b, -1 if a  b
func Compare(a, b []byte) int {
    for i := 0; i  b[i]:
            return 1
        case a[i]  len(b):
        return 1
    case len(a) 
タイプswitchスイッチ構文は、インターフェース変数の動的タイプを識別するために使用することができます。そのようなスイッチは型の言葉の文法を使用しますが、括弧でキーワード型を使用します。スイッチ式内で変数を宣言すると、変数は各節で一致する型を持つことになります。事実上、それぞれの句の中で新しい変数を別のタイプですが、同じ名前で宣言することと、各句の中で名前を再利用することが慣例的です。var t interface{}
t = functionOfSomeType()
switch t := t.(type) {
default:
    fmt.Printf("unexpected type %T\n", t)     // %T prints whatever type t has
case bool:
    fmt.Printf("boolean %t\n", t)             // t has type bool
case int:
    fmt.Printf("integer %d\n", t)             // t has type int
case *bool:
    fmt.Printf("pointer to boolean %t\n", *t) // t has type *bool
case *int:
    fmt.Printf("pointer to integer %d\n", *t) // t has type *int
}

functions.html.body:
関数(Functions)複数の戻り値Go言語が持つ特徴の1つは、関数とメソッドが複数の値を返すことができるということです。この形式は、 Cプログラムで帯域内エラーでEOFを表すために-1などの値を返し、アドレスに渡されたパラメータを変換するなど、いくつかの面倒な文法を改善するために使用されますできる。C言語では、任意の場所に秘密の方法でエラーコードと負の数で書き込みエラーを示します。 Go言語の[Write]（https://golang.org/pkg/os/#File.Write）では、カウントとエラーを返すことができます。 「うん、数バイトくらいは書いてたけどデバイスにいっぱいだから全てのバイトを書けなかった」 os パッケージファイルにある Write メソッドのシグネチャは次の通りです。func (file *File) Write(b []byte) (n int, err error)
そしてドキュメントでも言及しているように、Writeメソッドは n != len(b) の場合には使われたバイト数と nil ではなく error を返します。このような形式は非常に一般的であり、より多くの例を見たい場合は、エラーハンドリングセッションを見てみましょう。同様に、戻り値で参照パラメータの真似を行うことで、ポインタを渡す必要がなくなることがあります。以下は、数字と次の位置を返すことによってバイトスライスにある数字を取得する単純な関数です。func nextInt(b []byte, i int) (int, int) {
    for ; i 
または、次のように入力スライスbで数字をスキャンするためにも使用できます。    for i := 0; i 
名前付き結果引数Go関数では、戻り値「引数」または結果の「引数」に名前を付け、引数として入力されたパラメータのように通常の変数として使用できます。名前を付けると、対応する変数は、関数の開始時にそのタイプのゼロ値で初期化されます。関数が引数なしで戻り文を実行すると、結果パラメータの現在の値が戻り値として使用されます。名前を与えることは必須ではありませんが、名前を付けるとコードをより短くて明確にし、文書化になる。 nextIntの結果に名前を付ける場合、返される intがどのようなものか明確になる。func nextInt(b []byte, pos int) (value, nextPos int) {
有名な結果は初期化され、内容なしで返されるので、明確であるだけでなく単純になることができます。以下はこれを使った io.ReadFullバージョンです。func ReadFull(r Reader, buf []byte) (n int, err error) {
    for len(buf) > 0 && err == nil {
        var nr int
        nr, err = r.Read(buf)
        n += nr
        buf = buf[nr:]
    }
    return
}
DeferGoの deferステートメントは、 deferを実行する関数が返される前に即時関数呼び出し（延期された関数）を実行するように予約します。これは一般的な方法ではありませんが、関数がどのような実行パスを介して戻っている間にリソースを解放しなければならないかのような状況を処理する必要がある場合に効果的な方法です。最も代表的な例は、ミューテックスのロックを解除するか、ファイルを閉じることです。// Contents returns the file's contents as a string.
func Contents(filename string) (string, error) {
    f, err := os.Open(filename)
    if err != nil {
        return "", err
    }
    defer f.Close()  // f.Close will run when we're finished.

    var result []byte
    buf := make([]byte, 100)
    for {
        n, err := f.Read(buf[0:])
        result = append(result, buf[0:n]...) // append is discussed later.
        if err != nil {
            if err == io.EOF {
                break
            }
            return "", err  // f will be closed if we return here.
        }
    }
    return string(result), nil // f will be closed if we return here.
}
Closeのような関数の呼び出しを遅らせると、2つの利点が得られます。まず、ファイルを閉じることを忘れている間違いをしないようにしてください。関数に新しい戻りパスを追加する必要がある場合によく見られる間違いです。 2番目に openの近くに closeがあると、関数の末尾に位置するよりもはるかに明確なコードになることを意味します。defer関数のパラメータ（関数がメソッドの場合はレシーバも含まれます）は、関数の呼び出しが実行されるときではなくdeferが実行されたときに評価されます。また、関数の実行時に変数の値が変わることを心配する必要はありません。これは、1つのdefer呼び出し位置で複数の関数呼び出しを遅らせることができます。ここにやや幼稚な例があります。for i := 0; i 
遅延関数はLIFOシーケンスによって実行されるため、上記のコードでは関数が返されると4 3 2 1 0が出力されます。もっともっともらしい例として、プログラムを通して関数の実行を追跡する簡単な方法があります。ここでは、以下のような簡単なトレースルーチンをいくつか作成しました:func trace(s string)   { fmt.Println("entering:", s) }
func untrace(s string) { fmt.Println("leaving:", s) }

// Use them like this:
func a() {
    trace("a")
    defer untrace("a")
    // do something....
}
deferが実行されたときに遅延関数のパラメータが評価されるという事実を利用すると、より良いことができます。トレースルーチンは、以下のようにトレースを終了するルーチンのパラメータに設定できます:func trace(s string) string {
    fmt.Println("entering:", s)
    return s
}

func un(s string) {
    fmt.Println("leaving:", s)
}

func a() {
    defer un(trace("a"))
    fmt.Println("in a")
}

func b() {
    defer un(trace("b"))
    fmt.Println("in b")
    a()
}

func main() {
    b()
}
prints上記の関数は以下のような結果を出力します。entering: b
in b
entering: a
in a
leaving: a
