データnewを使ったメモリ割り当てGoにはメモリを割り当てる2つの基本的な方法がありますが、組み込み（built-in）関数であるnewとmakeです。さまざまなことをして他のタイプに適用されるので混乱するかもしれませんが、ルールは簡単です。 newから見てみましょう。組み込み関数でメモリを割り当てるが他の言語に存在する同じ名前の機能とは異なり、メモリを初期化せず、単に値をゼロ化する。つまり、new（T）は、タイプTの新しいオブジェクトにゼロ値が格納されているスペースを割り当て、そのオブジェクトのアドレスである * T値を返します。 Goの用語で言うと、新しくゼロ値に割り当てられたタイプTを指すポインタを返すのだ。newで返されたメモリはゼロ値を持つので、あえて初期化プロセスなしで使用されたタイプのゼロ値をそのまま書くことができるようにデータ構造を設計すれば役に立ちます。どういうわけか、データ構造のユーザーが新しい構造体を新しく作成してすぐに仕事に使用できるということです。例えば、bytes.Bufferの文書は、「Bufferのゼロ値はすぐに使用できるタングビンバッファである」と述べている。同様に、sync.Mutexも指定されたコンストラクタもInitメソッドも持っていない。代わりに、sync.Mutexのゼロ値であるロックされていないミューテックスとして定義されています。ゼロ値の有用性には転移的な特性がある。次のタイプ宣言を検討してみよう。type SyncedBuffer struct {
    lock    sync.Mutex
    buffer  bytes.Buffer
}
SyncedBuffer型の値はメモリ割り当てや単に宣言だけでもすぐに使用する準備ができます。以下のコードフラグメントでは、pとvの後の調整がなくても、すべて正確に機能します。p := new(SyncedBuffer)  // type *SyncedBuffer
var v SyncedBuffer      // type  SyncedBuffer
