Cとは異なり、ローカル変数のアドレスを返しても問題はありません。変数に連結された記憶空間は、関数が返しても生き残る。実際、合成リテラルのアドレスを取る表現は、毎回実行されるたびに新しいインスタンスに接続されます。したがって、最後の2行を結んでしまう可能性があります。    return &File{fd, name, nil, 0}
合成リテラルのフィールドは順番に配置され、必ず入力する必要があります。ただし、要素にラベルを付けてフィールド：値式で明示的にペアを作成すると、初期化は順序に関係なく表示されることがあります。入力されていない要素はそれぞれに合ったゼロ値を持ちます。したがって、以下のように書くことができる。    return &File{fd: fd, name: name}
限定的な場合には、合成リテラルが全くフィールドを持たない場合は、そのタイプのゼロ値を生成する。 new(File) は &File{} と同じ表現である。合成リテラルは、arrays、slices、およびmapsを生成するためにも使用できます。フィールドラベルとしてインデックスとマップのキーを適切に使用する必要があります。以下の例では、Enone、Eio、そしてEinvalの値に関係なく、互いに異なるだけで初期化が機能します。a := [...]string   {Enone: "no error", Eio: "Eio", Einval: "invalid argument"}
s := []string      {Enone: "no error", Eio: "Eio", Einval: "invalid argument"}
