タイプ変換equenceのStringメソッドは、Sprintがすでにスライスを持っていることを繰り返しています。しかし、Sprintを実行する前にSequenceを[] intに変換することで、作業を減らすことができます。func (s Sequence) String() string {
    sort.Sort(s)
    return fmt.Sprint([]int(s))
}
このような方法は、StringメソッドでSprintを安全に実行できるタイプ変換技法の別の例である。これが可能な理由は Sequence と []int 二つのタイプが名前だけ無視すれば同じであるため、合法的に互いに変換できることだ。この型変換は新しい値を作成せず、現在の値に新しい型があるかのように一時的に振る舞います。 （新しい値を作成する他の正当な変換もあります。たとえば、integerからfloating pointへの変換）Goプログラムで一群の他のメソッドを使用するために型を変換するのはGo言語らしい表現です。たとえば、[sort.IntSlice]（https://godoc.org/sort#IntSlice）を使用して、上記のプログラム全体を次のように簡素化できます。type Sequence []int

// プリントに必要なメソッド - プリントする前に要素をソートします。
func (s Sequence) String() string {
    sort.IntSlice(s).Sort()
    return fmt.Sprint([]int(s))
}
見て！ Sequence が複数の (整列と出力) インタフェースを実装する代わりに、1 つのデータアイテムが複数のタイプ (Sequence, sort.IntSlice, そして []int)に変換できる点を利用している。各タイプは、与えられたタスクのある部分をカバーします。実戦でよく使われないが非常に効果的かもしれない。インターフェース変換とタイプの断言タイプスイッチは変換の一形態である: インタフェースを受け取ったとき、switch文の各caseに合わせて型変換をする。以下の例は、fmt.Printf が型スイッチを使って、与えられた値を文字列に変換する方法を簡略化したバージョンで示しています。もし値がすでに文字列の場合はインタフェースがとっている実際の文字列値を望み、そうでなく値がStringメソッドを持っている場合はメソッドを実行した結果が欲しい。type Stringer interface {
    String() string
}

var value interface{} // callerによって提供された値。
switch str := value.(type) {
case string:
    return str
case Stringer:
    return str.String()
}
最初のケースは具体的な値が見つかった場合です。 2番目のケースは、インターフェースを別のインターフェースに変換した場合です。このように、いくつかのタイプを混ぜて使っても何の問題もありません。ひとつだけタイプだけに興味がある場合はどうでしょうか？もし与えられた値が文字列を保存することを知っていて、その文字列値を抽出したい場合は？たった1つのケースだけを持つタイプスイッチであれば解決することができますが、タイプ単言表現を書くこともできる。型段落は、インテフェース値を持ち、指定された明確な型の値を抽出する。文法は型スイッチを開くのと似ていますが、typeキーワードの代わりに明確な型を使用します:value.(typeName)
そして、結果として得られる新しい値はtypeNameという静的型です。その型は、インタフェースが保持している具体的な型でなければ、その値を変換できる2番目のインタフェース型でなければならない。与えられた値内の文字列を抽出するために、次のように書くことができます:str := value.(string)
しかし、その値が文字列を持っていない場合、プログラムはランタイムエラーを出して死ぬ。このような惨事に備えるためには、「comma, ok」イディオムを使用して安全に値が文字列であることを確認する必要があります:str, ok := value.(string)
if ok {
    fmt.Printf("string value is: %q\n", str)
} else {
    fmt.Printf("value is not a string\n")
}
もしタイプ断言が検査で失敗した場合、strはまだ文字列型として存在し、文字列のゼロ値である空の文字列を持ちます。可能な例を挙げると、上で示したタイプスイッチと同じ機能をするif-else文がここにある。if str, ok := value.(string); ok {
    return str
} else if str, ok := value.(Stringer); ok {
    return str.String()
}
一般性もしあるタイプがただインタフェースを実装するためだけに存在するなら、つまりインタフェース以外のどのメソッドも外部にノンツンさせていない場合、タイプ自体を露出させる必要はない。インタフェースだけを公開することは、与えられた値がインテフェスに描かれた行為以外に何の興味深い機能もないことを確実に伝える。これはまた、共通の方法に対する文書化の反復を避けることができる。そのような場合、コンストラクタは実装タイプではなくインタフェース値を返さなければなりません。たとえば、ハッシュライブラリであるcrc32.NewIEEEとadler32.Newはどちらも多インタフェースタイプ[hash.Hash32]（https://godoc.org/hash/Hash32）を返します。 GoプログラムでCRC-32アロリズムをAdler-32に置き換えるために必要なのは、単にコンストラクタコールを置き換えることです。他のコードはアルゴリズムの変化には影響されません。同様の方法で、さまざまな暗号化パッケージ内のストリーミングシッパーアルゴリズムを、それらが接続しているブロックシッパーから分離することができます。 crypto/cipher パッケージ内の [Block] (https://godoc.org/crypto/cipher#Block) インタフェースは、1 ブロックのデータを暗号化する block cipher の行為を定義する。次に、bufioパッケージから推測できるように、[Block]（https://godoc.org/crypto/cipher#Block）インタフェースを実装するcipherパッケージは、[Stream]（https://godoc.org/ crypto / cipher＃Stream）インターフェースに代表されるストリーミングcipherを構築するとき、ブロック暗号化の詳細を知らなくても使用することができる。crypto / cipherインターフェースは次のとおりです:type Block interface {
    BlockSize() int
    Encrypt(src, dst []byte)
    Decrypt(src, dst []byte)
}

type Stream interface {
    XORKeyStream(dst, src []byte)
}
ここでは、ブロックcipherをストリーミングcipherに置き換えるカウンタモード（CTR）ストリームの定義があります。 block cipherの詳細が抽象化されていることに注意してください:// NewCTRは、カウンダーモードで指定されたブロックを使用して暗号化および/復号化するストリームを返します。
// ivの長さはブロックのブロックサイズと同じでなければなりません。
func NewCTR(block Block, iv []byte) Stream
NewCTRは特定の暗号化アルゴリズムとデータソースにのみ適用されません。インタフェースを実装する任意のアルゴリズムやデータソースにも適用可能です。なぜなら、インタフェース値を返し、CTR暗号化を別の暗号化モードに置き換えることが局所的な変化であるからです。コンストラクタコールは必ず編集する必要があります。しかし、囲んでいるコードは戻り結果をStreamで処理しなければならないため、違いを知らない。インタフェースとメソッドほとんどすべてにメソッドを添付できるという言葉は、ほぼすべてがインタフェースを満たすことができるということでもある。 1つの会話的な例は、[http]（https://godoc.org/net/http）パッケージ内で定義されている[Handler]（https://godoc.org/net/http#Handler）インタフェースです。 [Handler]（https://godoc.org/net/http#Handler）を実装するどのオブジェクトもHTTPリクエストにサービスを提供できます。type Handler interface {
    ServeHTTP(ResponseWriter, *Request)
}
[ResponseWriter]（https://godoc.org/net/http#ResponseWriter）もクライアントに応答を返すために必要なメソッドのアクセスを提供するインタフェースです。これらのメソッドは標準のWriteメソッドを含み、[http.ResponseWriter](https://godoc.org/net/http#ResponseWriter)は[io.Writer](https://godoc.org/io#Writer)使用できる場所ならどこでも使用できる。はio.Writer使用できる場所ならどこでも使用できる。) Requestは、クライアントから来るリクエストの分析された内容を盛り込んだstructである。簡潔にするために、POSTは無視され、常にHTTPリクエストがGETであると仮定します。そのような単純化は、ハンドラーがどのようにシャットアップされるかに影響を与えません。ここではマイナーな例ですが、ページ訪問数を数えるハンダーの完全な実装があります。// シンプルなカウンターサーバー.
type Counter struct {
    n int
}

func (ctr *Counter) ServeHTTP(w http.ResponseWriter, req *http.Request) {
    ctr.n++
    fmt.Fprintf(w, "counter = %d\n", ctr.n)
}
（これまでの話と一脈相通する例として、Fprintfがhttp.ResponseWriterに出力できる注意してください。）参考までに、ここでURLにそのようなサーバーをどのように添付するかの例があります。import "net/http"
...
ctr := new(Counter)
http.Handle("/counter", ctr)
ところで、あえてCounterをstructにする理由があるのだろうか？ integerで十分です。 （callerに値の増加を示すために、レシーバはポインタである必要があります。）// シンプルなカウンターサーバー.
type Counter int

func (ctr *Counter) ServeHTTP(w http.ResponseWriter, req *http.Request) {
    *ctr++
    fmt.Fprintf(w, "counter = %d\n", *ctr)
}
あなたのプログラムの内部状態がページを訪問することを知る必要がある場合はどうでしょうか？ウェブページにチャンネルを結ぶ。//チャンネルが訪問ごとに通知されます。
//（おそらくこのチャネルにはバッファを使用する必要があります。）
type Chan chan *http.Request

func (ch Chan) ServeHTTP(w http.ResponseWriter, req *http.Request) {
    ch 
最後に、サーバーを駆動するために使用したコマンドライン引数を/ argsに表示したい場合を想像してみましょう。コマンドライン引数を出力する関数を書くのは簡単です。func ArgServer() {
    fmt.Println(os.Args)
}
これをどのようにHTTPサーバーに置き換えることができますか？どのタイプに加えて、値は無視しながらArgServerをメソッドにすることができます。しかし、より良い方法があります。ポインタとインタフェースだけを除いてはどのタイプにもメソッドを定義できる事実を利用して、関数にメソッドを書くことができる。 http パッケージには次のようなコードがあります:// HandlerFuncを使用すると、通常の関数をHTTPハンドラーとして書くことができます。
// f が適切な関数 signature を持つ場合、
// HandlerFunc（f）はfを呼び出すHandlerオブジェクトです。
type HandlerFunc func(ResponseWriter, *Request)

// ServeHTTP calls f(w, req).
func (f HandlerFunc) ServeHTTP(w ResponseWriter, req *Request) {
    f(w, req)
}
HandlerFuncはServeHTTPというマッソードを同じタイプで、このタイプの値はHTTP requestにサービスを提供する。メソッドの実装を見てみましょう：受信機は関数、fであり、メソッドはfを呼び出します。奇妙に思えるかもしれませんが、受信機がチャネルであり、メソッドがチャネルにデータを送信する例と比較しても、それほど変わりはありません。ArgServerをHTTPサーバーにするには、まず適切な署名を持つように修正する必要があります。// Argument server.
func ArgServer(w http.ResponseWriter, req *http.Request) {
    fmt.Fprintln(w, os.Args)
}
ArgServerは[HandlerFunc]（https://godoc.org/net/http#HandlerFunc）と同じ signature です。 IntSlice.Sortメソッドを書くためにSequenceを[IntSlice]（https://godoc.org/sort#IntSlice）に変換したように、ServeHTTPを書くためにArgServerをHandlerFuncに変換することができます。シャックアップを行うコードは非常に簡潔です:http.Handle("/args", http.HandlerFunc(ArgServer))
誰が/ argsを訪問したとき、そのページにインストールされたhandlerはArgServer値を持つ[HandlerFunc]（https://godoc.org/net/http#HandlerFunc）タイプです。 HTTP サーバはそのタイプの ServeHTTP メソッドを呼びながら ArgServer をレシーバとして使い、最終的に ArgServer を呼ぶことになる: HandlerFunc.ServeHTTP の中で f(w, req) を呼ぶことになる。その後、コマンドライン引数が表示されます。これまで、struct、integer、channel、そして関数（function）を持ってHTTPサーバーを作ってみました。これが可能な理由は、インタフェースがほぼすべての型で定義できる単純なメソッドの集合だからだ。

the_blank_identifier.html.body:
スペース識別子 (The blank identifier)私たちはすでに for rangeループと mapsを説明しながら、スペース識別子について2回言及しました。空白識別子は、何の損害もなく、任意の種類の値に割り当てまたは宣言できます。これは、Unixの /dev/null ファイル(必要はあるが実際の値は何の関係もない変数を格納する目的として使用される書き込み専用値)に値を渡すのと似ている。複数の割り当てにおける空白識別子for rangeループでスペース識別子を使用することは、一般的な状況での特別なケース（複数割り当て）です。左辺に余白の値を割り当てる必要があり、そのうちの1つが使用されていない場合、左辺に空白識別子を置くとダミー変数を生成する必要がなくなり、値を捨てることをきちんと処理することができる。たとえば、1つの値とエラーを返す関数を呼び出すためにエラーだけが重要である場合は、無関係な値を破棄するためにスペース識別子を使用します。if _, err := os.Stat(path); os.IsNotExist(err) {
    fmt.Printf("%s does not exist\n", path)
}
時々エラーを無視するためにエラー値を捨てるコードを見ることができます。これは非常に悪い慣行です。エラーの返却を常に確認してください。エラーが発生するには理由がある。// Bad! This code will crash if path does not exist.
fi, _ := os.Stat(path)
if fi.IsDir() {
    fmt.Printf("%s is a directory\n", path)
}
未使用のインポートと変数パッケージをインポートしたり、変数を宣言して書き込めなくなるとエラーが発生する。未使用のインポートはプログラムのサイズを膨らませ、コンパイル速度も低下させます。また、使用されていないが初期化された変数は少なくとも操作を無駄にし、多分大きなバグを暗示するかもしれません。しかし、プログラムが開発中にあるとき、未使用のインポートと変数がしばしば発生することになり、ただコンパイルが進むようにするために後で再び必要になるこれらをクリアするのは面倒かもしれない。スペース識別子はこれを回避する方法を提供します。以下の半分の完成したプログラムには、2つの未使用インポート（ fmt、 io）と未使用変数（ fd）があります。したがって、これはコンパイルされません。しかし、これまでコードが正確に作られているかどうかを知ることができれば良いでしょう。package main

import (
    "fmt"
    "io"
    "log"
    "os"
)

func main() {
    fd, err := os.Open("test.go")
    if err != nil {
        log.Fatal(err)
    }
    // TODO: use fd.
}
未使用のインポートに関する文句を潜在的にするには、インポートされたパッケージのシンボルを参照するスペース識別子を書きます。同様に、未使用変数 fd を空白識別子に割り当てると、未使用変数に対するエラーが発生する可能性があります。このバージョンのプログラムはコンパイルになります。package main

import (
    "fmt"
    "io"
    "log"
    "os"
)

var _ = fmt.Printf // For debugging; delete when done.
var _ io.Reader    // For debugging; delete when done.

func main() {
    fd, err := os.Open("test.go")
    if err != nil {
        log.Fatal(err)
    }
    // TODO: use fd.
    _ = fd
}
規約によれば、インポートエラーを潜在させるためのグローバル宣言は、インポート構文の直後に置かれ、注釈を付けなければならない。彼らは後でコードを整理する必要があることを簡単に思い出させ、見つけやすくします。付随効果のためのインポート前の例では、fmtやioのような未使用のインポートは最終的に使用されるべきであるか、そうでなければ排除されるべきです。 （空白の割り当てはまだ作業が進行中のコードとして認識されなければなりません）。例えば、net/http/pprofパッケージは、パッケージの初期化関数の実行中にデバッグ情報を提供するHTTPハンドラを登録します。これは公開されたAPIを持っていますが、大部分のクライアントはハンドラー登録のみを必要とし、情報にはWebページを介してアクセスします。付随効果のためにこのパッケージをインポートするには、このパッケージ名を空白の識別子に変更するだけです:import _ "net/http/pprof"
この形式のインポートは、パッケージが付随効果のためにインポートされていることを明確にすることができます。なぜなら、このファイルではパッケージが名前を持っていないので使用される可能性がないからです。 （名前があり、それを使用しない場合、コンパイラはプログラムを拒否します。）インターフェース検査上記のインタフェースについての議論で示したように、型はインタフェースを実装したことを明示的に宣言する必要はありません。代わりに、型はインタフェースのメソッドを実装することによってインタフェースを実装します。実際、大部分のインタフェース変換は静的であるため、コンパイル中に検査が行われます。例えば、もし *os.File が io.Reader インタフェースを実装していないが、それを io.Reader を期待する関数に引数として渡すとコンパイルされないだろう。しかし、いくつかのインターフェイスチェックは実行時に発生します。 1つの例は、 Marshalerインタフェースを定義する encoding / jsonパッケージにあります。 JSONエンコーダがそのインタフェースを実装した値を受け取ると、エンコーダはJSONに変換するために標準変換を進める代わりに値の marshilingメソッドを実行します。エンコーダは、ランタイム時に次のようにタイプの断言をしながらプロパティを検査する。m, ok := val.(json.Marshaler)
型がインタフェースを実装していないかどうかを実際のインタフェース自体を使用せずに、エラーチェックの一部として確認する必要がある場合は、型が指定された値を無視するために空白識別子を使用してください:if _, ok := val.(json.Marshaler); ok {
    fmt.Printf("value %v of type %T implements json.Marshaler\n", val, val)
}
このような状況が現れる場合は、パッケージが実際にインタフェースを満たすタイプを実装していることを保証する必要があるときです。もしあるタイプがカスタマイズされたJSON表記法が必要な場合(例えば、json.RawMessage)、これはjson.Marshalerを実装しなければならない。しかし、コンパイラにそれを自動的に確認させる静的な変換はありません。誤って型がそのインタフェースを満たすことに失敗すると、JSONエンコーダはまだ実行されますが、カスタマイズされた実装を使用できなくなります。インタフェースの実装を保証するために、パッケージ内でスペース識別子を使用するグローバル宣言を使用できます。var _ json.Marshaler = (*RawMessage)(nil)
上記の宣言では、「 RawMessage」を「Marshaler」に変換する割り当てによって、「 RawMessage」に「Marshaler」を実装する必要があり、これらの属性はコンパイル時にチェックされます。もし json.Marshalerインタフェースに変化が生じた場合、このパッケージはもはやコンパイルされなくなり、パッケージが更新されなければならないことを知らせる。この構造では、空白の識別子が現れることは、上記の宣言が変数を作成するのではなく、型チェックのためにのみ存在することを示しています。しかし、これを1つのインタフェースを満たすすべてのタイプに使用しないでください。規約によれば、上記のような宣言は珍しい場合であるが、すでにコードに存在する静的変換がない場合にのみ使用することである。

embedding.html.body:
埋め込み(Embedding)Goは典型的なタイプ主導型のサブクラス化を提供しません。しかし、structやインタフェースに型を埋め込むことで実装体の一部を「借りる」ことは可能である。インタフェースの埋め込みは非常に簡単です。すでに言及されている io.Reader と io.Writer インタフェースの定義を見てみましょう。type Reader interface {
    Read(p []byte) (n int, err error)
}

type Writer interface {
    Write(p []byte) (n int, err error)
}
ioパッケージは、いくつかの別のインタフェースを公開しており、複数のメソッドを実装できるオブジェクトを指定するのに書く。たとえば、[io.ReadWriter]（https://godoc.org/io#ReadWriter）はReadとWriteの両方を持っています。 2つのメソッドを明示的にリストして[io.ReadWriter]（https://godoc.org/io#ReadWriter）を定義することもできますが、より簡単で覚えやすい方法は2つのインターフェースを埋め込むことによって（embedded） 1つのインターフェースを形成することです:// ReadWriterはReaderとWriterインターフェースを組み合わせたインターフェースです。
type ReadWriter interface {
    Reader
    Writer
}
見えるように ReaderがすることとWriterがすることを[ReadWriter](https://godoc.org /io＃ReadWriter）はすべてできることです。埋め込まれたインタフェースの組み合わせである（共通のメソッドを持たないインタフェースでなければならない）。インターフェイスだけがインターフェイスに挿入できます。基本的に同じ考えがstructにも適用できるが、その影響ははるかに広範囲である。 bufioパッケージには bufio.Reader と bufio.Writer はまたバッファを内在した reader/writer を実装することもあるが、埋め込み（embedding）を利用して reader と writer を 1 つの struct に組み合わせるものである。タイプをリストしますが、フィールド名を与えない方法です。// ReadWriter ReaderとWriterへのポインタを保存します。
// io.ReadWriterを実装します。
type ReadWriter struct {
    *Reader  // *bufio.Reader
    *Writer  // *bufio.Writer
}
埋め込まれた要素はstructを指すポインタであり、もちろん使用する前に有効なstructでポイントをかけて初期化させなければならない。 ReadWriter structは以下のように書くことができる。type ReadWriter struct {
    reader *Reader
    writer *Writer
}
しかし、これを行うには、[io]（https://godoc.org/io）を満たし、readerとwriterが持っているメソッドを使用するために、転送用のメソッドを別々に提供する必要があります。func (rw *ReadWriter) Read(p []byte) (n int, err error) {
    return rw.reader.Read(p)
}
このような面倒なことを避けるためには、structを直接埋め込むことができます。埋め込まれた型のメソッドは自動的に続き、その意味は bufio.ReadWriter は bufio.Readerのメソッドの両方を持つことになるという。同時に、次の3つのインターフェースを満たすこともできます：io.Reader、io.Writer](https://godoc.org/io#Writer)、 io.ReadWriter。それでは、埋め込みがサブクラス化とは異なる重要な方法を見てみましょう。型を埋め込むと、その型のメソッドが外部型のメソッドになります。ただし、呼び出されたメソッドの受信機は内部型ではなく外部型ではありません。例では、[bufio.ReadWriter]（https：//godoc.org/bufio.ReadWriter）のReadメソッドが呼び出されたときに、転送メソッドを使用したのと同じ効果があります。レシーバーはReadWriterのリーダーフィールドであり、ReadWriter自体ではないのだ。埋め込みは単純な便利さでもあります。この例では、埋め込まれたフィールドを名前付きの通常のフィールドとともに表示します。type Job struct {
    Command string
    *log.Logger
}
Job型は、今度は * log.Loggerに属するLog、Logf、そして他のメソッドを持っています。 Loggerに名前を与えることもできただろうが、そうする必要は全くない。そして今、初期化されたら、Jobに直接logを使うことができます:job.Log("starting now...")
LoggerはJob structの通常フィールドであるため、コンストラクタ内で常に行うように、次のように初期化できます。func NewJob(command string, logger *log.Logger) *Job {
    return &Job{command, logger}
}
またはcomposite literalを書いてjob := &Job{command, log.New(os.Stderr, "Job: ", log.Ldate)}
埋め込まれたフィールドに直接言及する必要がある場合、ReadWriter structのReadメソッドのように、パッケージを無視したフィールドのタイプ名がフィールドの名前として使用されます。 Job 型の変数である job の *log.Logger にアクセスする必要がある場合は、 job.Logger と書けばよく、Logger のメソッドを改善したい場合に便利です。func (job *Job) Logf(format string, args ...interface{}) {
    job.Logger.Logf("%q: %s", job.Command, fmt.Sprintf(format, args...))
}
埋め込みタイプは名前の競合の問題を引き起こす可能性がありますが、解決するルールは簡単です。まず、フィールドやメソッドXは、型内のより深く入れ子になった部分にある別のXを隠して見えません。 log.LoggerがCommandというフィールドまたはメソッドを持っている場合、JobのCommandフィールドがより優勢です。第二に、同じ名前が同じレベルでネストされて表示されると、通常はエラーが発生します。 Job structがLoggerという名前のフィールドやメソッドを持っている場合、log.Loggerを埋め込むのは間違っています。しかし、複製された名前が型定義の外で使用されたことがなければ大丈夫です。この資格は、外から埋め込まれたタイプに生じる変化に対するある程度の保護を提供します。 1つのフィールドが追加され、別のサブタイプのフィールドと競合が発生した場合、どちらのフィールドも使用されていない場合は問題ありません。

concurrency.html.body:
同時性(Concurrency)通信による共有並行性プログラミングは広範なトピックなので、ここではGoに限定されている重要なものについてのみ地面を割く。共有変数への正確なアプローチを実装するために厳守する必要がある細部は、さまざまな環境で並行性プログラミングを困難にしました。 Goは、共有変数がチャンネルを返して渡されるという点で、他のアプローチをお勧めします。そして実際、共有変数は個々のスレッドの実行によって決して共有されません。いつでも1つのゴルチンが値にアクセスします。データ競合は、実装設計では発生できません。この考え方を奨励するために、これを1つのスローガンに減らしました。共有メモリと通信してはいけない。代わりに、通信でメモリを共有します。このアプローチはあまりにも過度のものかもしれません。例えば、整数型変数の周囲にミューテックスを置く方式のリファレンスカウントが最高かもしれない。しかし、より高いレベルでアクセスする方法として、アクセスを制御するチャネルを使用すると、明確で正確なプログラムをより簡単に作成できます。このモデルについて考える1つの方法は、単一のCPUで実行される典型的なシングルスレッドプログラムを思い出すことです。これは同期のための基本的なデータ型を必要としません。今別のインスタンスを実行してみてください。しかし、やはり同期は必要ありません。これで2つの通信が可能になりますが、その通信自体が同期装置である場合、まだ他の同期は必要ありません。たとえば、Unixパイプラインはこのモデルに完全に収まります。同時性に対するGoのアプローチは、Hoareのコミュニケーションシーケンシャルプロセス（CSP、Communicating Sequential Processes）から来ているが、タイプセーフティが保証される式の一般化されたUNIXパイプと見なすことができる。ゴルティンスレッド、コルーチン、プロセスなど、既存の用語は不正確な意味を伝えるため、ゴルチンと呼ばれます。ゴルチンは単純なモデルです。つまり、同じアドレス空間で他のゴルチンと同時に実行される関数である。ゴルチンは軽い。スタック領域を割り当てるよりもコストがかかります。そしてそのスタックは小さなサイズで始まります。だから安いです。そして必要なだけヒープストレージを割り当て（または解放）して大きくなる。ゴルチンはOSのマルチスレッドに多重化されますが、I / O操作のために待機しているときのように、1つのゴルチンがブロックされると、別のゴルチンが実行され続けます。この設計は、スレッドの複雑な作成と管理についてあえて知る必要がなくなります。新しいゴルチンを呼び出して実行するには、goキーワードを関数またはメソッド呼び出しの前に置きます。呼び出しが完了すると、ゴルチンは自動的に終了します。 （バックグラウンドでコマンドを実行するUnixシェルと表記と同様の効果です。）go list.Sort()  // list.Sort를 （ソートが完了するまで）待たずに同時に実行
関数リテラルはゴルチン呼び出しに役立ちます。func Announce(message string, delay time.Duration) {
    go func() {
        time.Sleep(delay)
        fmt.Println(message)
    }() //かっこに注意 - 関数を呼び出す必要があります
}
Goでは、関数リテラルはクロージャです。つまり、関数が参照する変数を使用している間は、その生存を保証する方法で実装されているということです。上記の例は、関数が終了を知らせる方法がないため、非常に実用的ではありません。これにはチャネルが必要です。チャンネルマップと同様に、チャネルは make に割り当てられ、結果の値は実際のデータ構造への参照として機能します。オプションの整数型パラメータが与えられると、チャネルのバッファサイズが設定されます。この値は、アンバッファードまたは同期チャネルのデフォルト値が0です。ci := make(chan int)            // 整数型のアンバッファードチャンネル
cj := make(chan int, 0)         // 整数型のアンバッファードチャンネル
cs := make(chan *os.File, 100)  // Fileポインタ型のバッファドチャンネル
バッファなしのチャネルは、同期で値を交換し、両方の計算（ゴルチン）がどの状態にあるかを知ることができることを保証する通信を組み合わせます。チャンネルを使用する素晴らしいゴージャスなコードがたくさんあります。次の例で始めましょう。前のセクションでバックグラウンドでソートしました。チャネルは、ソートが完了するまでゴルチン実行を待つことができる。c := make(chan int)  // チャンネルを割り当てる
// ゴルチンでアライメントを開始し、完了するとチャンネルに信号を送信する
go func() {
    list.Sort()
    c 
