    Error() string
}
ライブラリ開発者は見えませんが、より豊富なモデルを使用して上記のインタフェースを自由に実装しながら、エラーを示すだけでなく、どのようなコンテキストを一緒に提供することも可能です。言及したように、通常 os.Open は *os.File 値を返すと同時にエラー値も返します。ファイルが正常にオープンされた場合、エラーは nilになり、オープン中に問題が発生した場合は os.PathErrorの値があります:// PathErrorはエラーと演算、問題を発生させたファイルパスを持っている。
type PathError struct {
    Op string    // "open", "unlink", など.
    Path string  // 関連ファイル.
    Err error    // システムコールによって返される.
}

func (e *PathError) Error() string {
    return e.Op + " " + e.Path + ": " + e.Err.Error()
}
PathErrorの Errorメソッドは次のような文字列を生成します:open /etc/passwx: no such file or directory
上記のエラーは、問題が発生したファイル名と操作、そして問題を発生させたオペレーティングシステムエラーを持っており、これは問題を発生させたシステムコールから遠く離れたところで見せても便利です。これは単に no such file or directoryを示すよりもはるかに多くの情報を提供します。可能であれば、エラー文字列は、エラーが発生したコマンドやパッケージをプレフィックスとして書き込むなど、エラーの原因を特定できるはずです。たとえば、 imageパッケージで不明なフォーマットによって発生したデコードエラーのための文字列表現は image：unknwon format.です。正確な詳細エラーの内容に興味がある発信者は、詳細および追加の情報を取得するためにタイプスイッチングまたはタイプステートメントを使用できます。 PathErrorsの場合、エラーを修復するために内部 Errフィールドを調べることができます。for try := 0; try 
