func CubeRoot(x float64) float64 {
    z := x/3   // 任意の初期値
    for i := 0; i 
これは一例です。実際のライブラリ関数は panicを避けるべきです。もし問題が隠れていたり、周辺で問題を発生させても、実行を続けるのがプログラム全体を終了するよりも優れている。 1つの可能な反例は初期化作業中ですが、ライブラリが初期設定に失敗した場合はパニックを発生させ、通知する必要があります。var user = os.Getenv("USER")

func init() {
    if user == "" {
        panic("no value for $USER")
    }
}
回復 (Recover)スライスの範囲を超えたインデックス付けやタイプの断言失敗などのランタイムエラーを含むパニックが発生した場合、これは直ちに現在の関数の実行を中断させ、すべての遅延された（deferred）関数を実行しながらゴルチンスタックを解き始める。解凍操作がゴルチンスタックの最上位に達すると、プログラムは終了します。しかし、組み込み関数である recover を使うとゴルチンの制御権を再び得ることができ、命令実行を正常に進めることができるようになる。recoverを呼び出すと、解凍操作が中止され、panicに渡された引数の値が返されます。解凍操作中に実行されるコードは遅延関数内でのみ実行されるため、 recoverは遅延関数内でのみ有用です。recoverの1つのアプリケーションの1つは、サーバー内の実行中の他のゴルチンは殺さず、失敗したゴルチンだけを終了させることです。func server(workChan 
この例では、「do（work）」でパニックが発生した場合、結果はログに残り、ゴルチンは他のゴルチンを妨げることなくきちんと終了します。呼び出された recoverがこの状況を完全に処理するので、遅延されたクロージャでは何もする必要はありません。recoverは遅延関数から直接呼び出される場合を除いて常にnilを返すので、遅延コードは panic'とrecoverを使用するライブラリルーチンを失敗せずに呼び出すことができる。一例を挙げると、safelyDo内の遅延関数はrecover`を呼び出す前にlogging関数を呼び出すことができ、loggingコードはパニック状態に影響されずにうまく実行されるだろう。上記の復旧パターンを見ると、 do関数（そして呼び出しを行うどれも）は panicを呼び出すことで悪い状況を避けることができる。このアイデアを活用すると、複雑なソフトウェアでのエラー処理を簡素化できます。 regexpパッケージの最も理想的なバージョンを見てみましょう。これは、独自のエラータイプで panicを呼び出すことによって解析エラーを通知します。以下に Error とエラーメソッド、そして Compile 関数の定義がある。// Errorは解析エラータイプで、errorインタフェースを満たしています。
type Error string
func (e Error) Error() string {
    return string(e)
}

// errorは、Errorのパニックで解析エラーを通知する* Regexpメソッドです。
func (regexp *Regexp) error(err string) {
    panic(Error(err))
}

// Compileは正規表現の解析された表現を返します。
func Compile(str string) (regexp *Regexp, err error) {
    regexp = new(Regexp)
    // doParseは、解析中にエラーが発生するとパニックを引き起こします。
    defer func() {
        if e := recover(); e != nil {
            regexp = nil    // 戻り値クリア
            err = e.(Error) // 解析エラーでなければ再パニック
        }
    }()
    return regexp.doParse(str), nil
}
doParseがパニックを起こした場合、回復ブロックは戻り値をnilに設定します。遅延関数は名前付き戻り値を変更できます。 errに値を代入する過程でエラーを独自のエラータイプと断言することで、その問題が解析エラーかどうかをチェックすることになる。もし解析エラーでなければ、タイプの断言は失敗し、まるで何の中断がなかったかのようにスタック解凍作業を進め、ランタイムエラーを起こすだろう。このチェックは、インデックスが範囲外であるなど、意図しないことが発生したときに解析エラーを処理するために panicと recoverを使用したにもかかわらず、コードが失敗することを意味します。以下のエラー処理を見ると、エラーメソッドは（タイプにバインドするメソッドなので、組み込みエラータイプと同じ名前を使用するのは自然で大丈夫です）、直接解析スタックを解くことを心配することなく解析エラーを通知するのは簡単です:if pos == 0 {
    re.error("'*' illegal at start of expression")
}
このパターンは有用であるにもかかわらず、パッケージ内でのみ使用する必要があります。 Parseは内部パニック呼び出しをエラー値に置き換えます。これはクライアントにパニックを公開しません。これは見受けられる良いルールです。確かに、 re-panicイディオムは実際にエラーが発生したときにパニック値を変更します。しかし、元の値と新しい失敗の両方がエラー報告に表示されるため、問題の根本的な原因も依然として見られます。したがって、（プログラムがクラッシュしたことを考えると）、これらの単純な re-panic アプローチが十分であると見ることができますが、元の値だけを表示したい場合は、意図しない問題をフィルタリングするコードを書くことができ、元のエラーを持って re-panicをすることができる。これは読者に宿題として残す。

a_web_server.html.body:
Webサーバー完全なGoプログラムであるWebサーバーで終了しましょう。これは実際には一種のWebサーバーです。Googleは、chart.apis.google.com データをチャートやグラフに自動フォーマットするサービスを提供しています。ただし、データをクエリとしてURLに入力する必要があるため、インタラクティブに使用するのは困難です。ここでのプログラムは、1つの形式のデータへのより優れたインターフェイスを提供します。短いテキストが与えられると、チャートサーバーを呼び出して、テキストをエンコードするボックスのマトリックスであるQRコードを生成します。その画像は携帯電話のカメラで取得して、たとえばURLとして解釈できるため、携帯電話の小さなキーボードにURLを入力する手間が省けます。これが完全なプログラムです。説明は次のとおりです。package main

import (
    "flag"
    "html/template"
    "log"
    "net/http"
)

var addr = flag.String("addr", ":1718", "http service address") // Q=17, R=18

var templ = template.Must(template.New("qr").Parse(templateStr))

func main() {
    flag.Parse()
    http.Handle("/", http.HandlerFunc(QR))
    err := http.ListenAndServe(*addr, nil)
    if err != nil {
        log.Fatal("ListenAndServe:", err)
    }
}

func QR(w http.ResponseWriter, req *http.Request) {
    templ.Execute(w, req.FormValue("s"))
}

const templateStr = `


QR Link Generator


{{if .}}


{{.}}


{{end}}




`
これまでの部分mainは簡単に理解できるはずです。oneフラグは、サーバーのデフォルトのHTTPポートを設定します。テンプレート変数templは、楽しみが発生する場所です。サーバーがページを表示するために実行するHTMLテンプレートを作成します。それについてはすぐに詳しく説明します。関数はフラグを解析し、上記mainで説明したメカニズムを使用して、関数QRをサーバーのルートパスにバインドします。次にhttp.ListenAndServe、サーバーを起動するために呼び出されます。サーバーの実行中はブロックします。QRフォームデータを含むリクエストを受信し、という名前のフォーム値のデータに対してテンプレートを実行するだけsです。テンプレート文字列の残りの部分は、ページが読み込まれたときに表示されるHTMLにすぎません。説明が速すぎる場合は 、テンプレートパッケージ のドキュメントを参照して、より詳細に説明してください。そして、あなたはそれを持っています：数行のコードといくつかのデータ駆動型HTMLテキストの便利なウェブサーバー。Goは、数行で多くのことを実現するのに十分強力です。
